import React from 'react';

function Header() {
    const client = "Programming";
    const title_designer = "Design";
    const title_programming = "Programming";

    return (
        <div className='shadow-sm bg-dark p-3 text-white rounded'>
            <h1>
                {client === "Designer" ? title_designer : title_programming} 
                is my life
            </h1>
        </div>
    );
};

export default Header;
